import React from 'react'

function Todos() {
    return (
        <div className='bg-[#466292] h-[40px] rounded-lg w-[40%] flex flex-col items-center justify-between px-5'>
            <h1>Test Todo</h1>
            <div className='rounded-full bg-red-500 p-2' />
        </div>
    )
}

export default Todos
